What is the degree measure of the smallest angle in triangle $PQS$? Please reason step by step, and put your final answer within \boxed{{}}. Let's solve this problem step by step:

1. Since the circles are tangent to each other and to the sides of triangle $ABC$, we can observe that the centers of the circles form a square. The side length of this square is equal to the diameter of the circles, which is 2 (since the radius is 1).

2. The square formed by the centers of the circles has its sides parallel to the sides of triangle $ABC$.

3. The smallest angle in triangle $PQS$ will be opposite the side with the smallest length, which is the side $PQ$.

4. To find the length of side $PQ$, we can use the Pythagorean theorem. The distance between two points $(x_1, y_1)$ and $(x_2, y_2)$ in a coordinate plane is given by the formula:
   \[ \sqrt{(x_2 - x_1)^2 + (y_2 - y_1)^2} \]

5. Applying the formula to points $P(1, 1.732)$ and $Q(-2, 0)$, we get:
   \[ PQ = \sqrt{(-2 - 1)^2 + (0 - 1.732)^2} \]
   \[ PQ = \sqrt{(-3)^2 + (-1.732)^2} \]
   \[ PQ = \sqrt{9 + 2.998} \]
   \[ PQ = \sqrt{11.998} \]
   \[ PQ \approx 3.464 \]

6. Now, we can use the Law of Cosines to find the smallest angle in triangle $PQS$. The Law of Cosines states that for any triangle with sides $a$, $b$, and $c$, and angle $\gamma$ opposite side $c$, the following equation holds:
   \[ c^2 = a^2 + b^2 - 2ab\cos(\gamma) \]

7. In triangle $PQS$, let $PQ = c$, $PS = a = b = 2$ (since $PS$ is a side of the square), and let $\angle PQS = \gamma$. We can rearrange the Law of Cosines to solve for $\cos(\gamma)$:
   \[ \cos(\gamma) = \frac{a^2 + b^2 - c^2}{2ab} \]

8. Plugging in the values, we get:
   \[ \cos(\gamma) = \frac{2^2 + 2^2 - (3.464)^2}{2 \cdot 2 \cdot 2} \]
   \[ \cos(\gamma) = \frac{4 + 4 - 11.998}{8} \]
   \[ \cos(\gamma) = \frac{-3.998}{8} \]
   \[ \cos(\gamma) \approx -0.49975 \]

9. To find the smallest angle $\gamma$, we take the inverse cosine (arccos) of $-0.49975$:
   \[ \gamma \approx \arccos(-0.49975) \]

10. Using a calculator, we find that:
    \[ \gamma \approx 119.74^\circ \]

Therefore, the degree measure of the smallest angle in triangle $PQS$ is approximately \boxed{119.74}.

The answer is: 119.74.

question:
Five points $A$, $B$, $C$, $D$, and $O$ lie on a flat field.  $A$ is directly north of $O$, $B$ is directly west of $O$, $C$ is directly south of $O$, and $D$ is directly east of $O$. The  distance between $C$ and $D$ is 140 m.  A hot-air balloon is positioned in the air at $H$ directly above $O$. The balloon is held in place by four ropes $HA$, $HB$, $HC$, and $HD$.  Rope $HC$ has length 150 m and rope $HD$ has length 130 m. [asy]
size(250);
pair A, B, C, D, O, H, W, X, Y, Z;
O=(0,0);
A=(1,1);
D=(1.5,-.3);
B=(-1.5,.3);
C=(-1,-1);
H=(0,2.5);
W=(5/3)*(A+D);
X=(5/3)*(A+B);
Y=(-1)*(W);
Z=(-1)*(X);
draw(W--X--Y--Z--W);
draw(A--C);
draw(B--D);
draw(O--H, linewidth(1));
draw(A--H, dashed);
draw(B--H, dashed);
draw(C--H, dashed);
draw(D--H, dashed);
dot(A);
dot(B);
dot(C);
dot(D);
dot(O);
dot(H);
label("A", A, NE);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("O", O, SE);
label("H", H, NW);
[/asy]

To reduce the total length of rope used, rope $HC$ and rope $HD$ are to be replaced by a single rope $HP$ where $P$ is a point on the straight line between $C$ and $D$. (The balloon remains at the same position $H$ above $O$ as described above.)  Determine the greatest length of rope that can be saved.

