1. We have a right triangle formed by points $A$, $O$, and $C$ since $A$ is directly north of $O$ and $C$ is directly south of $O$. The length of $AO$ (which is the same as $CO$) is 140 m.

2. We also have a right triangle formed by points $B$, $O$, and $D$ since $B$ is directly west of $O$ and $D$ is directly east of $O$. The length of $BO$ (which is the same as $DO$) is 140 m.

3. The length of rope $HC$ is 150 m, and the length of rope $HD$ is 130 m.

4. We want to find the greatest length of rope that can be saved by replacing $HC$ and $HD$ with a single rope $HP$ that connects point $P$ on the line between $C$ and $D$ directly above $H$.

5. Let's denote the length of $HP$ as $x$. The length of $HP$ is the hypotenuse of a right triangle with legs $HC$ and $HD$.

6. Using the Pythagorean theorem, we have:
   \[ x^2 = (HC)^2 + (HD)^2 \]
   \[ x^2 = 150^2 + 130^2 \]
   \[ x^2 = 22500 + 16900 \]
   \[ x^2 = 39400 \]
   \[ x = \sqrt{39400} \]
   \[ x = 198.9949493661 \]

7. The total length of rope used with $HC$ and $HD$ is $150 + 130 = 280$ m.

8. The total length of rope used with $HP$ is $x = 198.9949493661$ m.

9. The greatest length of rope that can be saved is the difference between the total length of rope used with $HC$ and $HD$ and the length of $HP$:
   \[ \text{Length saved} = 280 - 198.9949493661 \]
   \[ \text{Length saved} = 81.0050506339 \]

10. Rounding to the nearest whole number, we get $\boxed{81}$ meters as the greatest length of rope that can be saved.

The final answer is \boxed{81}.

The answer is: 81.

